var uniq1=function(arr){
	var temp=[],
		item,
		i,n;

	for(i=0;i<arr.length;i+=1){//开始去重
		item=arr[i];
		temp.push(item);
		for(n=0;n<temp.length;n+=1){
			if(item===temp[n-1]){//如temp与arr中的元素重复则删除
				temp.splice(temp.length-1,1);
			}
			// compare(temp,n,item);
		}
	}
	return temp;
};

var uniq2=function(arr){
	var i,temp=[],
		key,newArr=[];

	for(i=0;i<arr.length;i+=1){//遍历数组，将值作为键名放入对象中
		temp[arr[i]] = (temp[arr[i]]+1)||1;//typeof arr[i];//对象值随便赋，用作重复次数的统计或者存储值的类型是不错的选择
	}

	for(key in temp){//把生成的临时对象转回数组
		newArr.push(JSON.parse(key));
	}
	return newArr;
};

var uniq3=function(arr){
	var i,tempArr=[],x,n;

	for(i=0;i<arr.length;i+=1){
		tempArr.push(arr[i]);
	}

	for(i=0;i<tempArr.length;i+=1){
		for(x=i+1;x<tempArr.length;x+=1){//一一剔除重复值
			if(tempArr[i]===tempArr[x]){
				tempArr.splice(x,1);
				x-=1;
			}
		}
	}

	// console.log(tempArr)
	return tempArr;
};

var uniq4=function(arr){
	const seen=new Map();
	return arr.filter((a)=>!seen.has(a)&&seen.set(a,1));
};

